import React from 'react';

const DialogBox = () => {
  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center">
      <div className="bg-blue-800 text-white p-6 rounded-lg max-w-lg mx-auto">
        <div className="flex flex-col items-center">
          {/* Replace path/to/your/image.png with the path to your actual handshake icon image */}
          <img src="path/to/your/handshake-icon.png" alt="Handshake" className="mb-4" />
          <h2 className="text-2xl font-bold mb-3">Welcome to "Your Brand Name"</h2>
          <p className="text-lg mb-6">Finding your perfect card is just a click away.</p>
          <button className="bg-purple-600 text-white font-bold py-2 px-4 rounded hover:bg-purple-700 transition-colors">
            Create your Card
          </button>
        </div>
      </div>
    </div>
  );
};

export default DialogBox;
